column13:
Erfindungsgemäss wird ein System (2) zum Auftanken von Fahrzeugen mit wasserstoff-elektrischem Antrieb und zum Aufladen von Fahrzeugen mit batterie-elektrischem Antrieb offenbart, umfassend: 
a) einen wiederbefüllbar ausgestalteten Wasserstoffspeicher (8) und/oder eine Wasserstoff-Pipeline (10) zur Versorgung des Systems (2), insbesondere einer Wasserstoff-Tankstelle, mit Wasserstoff; 
b) mindestens einen ersten Förderstrang (12) zur Bereitstellung von aus dem Wasserstoffspeicher (8) und/oder von aus einer Wasserstoff-Pipeline (10) stammenden Wasserstoffs, vorzugsweise komprimiertem Wasserstoff, an mindestens einer Wasserstoffübergabevorrichtung (20a und 20b), insbesondere einer Zapfpistole; 
c) mindestens eine Konvertierungseinheit (26) zur Konversion von Wasserstoff in elektrische Energie; 
d) mindestens einen zweiten Förderstrang (22) zur Bereitstellung von aus dem Wasserstoffspeicher (8) und/oder aus der Wasserstoff-Pipeline (10) stammenden Wasserstoffs, vorzugsweise komprimierter Wasserstoff, an der mindestens einen Konvertierungseinheit (26); und 
e) mindestens eine ausgangsseitig mit der mindestens einen Konvertierungseinheit (26) verbundene Aufladevorrichtung (30a bis 30d) mit mindestens einem Ladeplatz für die Fahrzeuge mit batterie-elektrischem Antrieb. Die vorliegende Erfindung beschreibt die Nutzung der identischen Infrastruktur und Logistik der Energieversorgung von Wasserstoff-Tankstellen für die Betankung von Fahrzeugen mit wasserstoff-elektrischem Antrieb und für die Aufladung von Fahrzeugen mit batterie-elektrischem Antrieb.

Disclosed is an antihalation dye and a photographic element containing such dye of the formula:

 wherein 
X¹, X² independently represents -CR⁸R⁹-, -S-, -Se-, -NR¹⁰, -CH=CH- or -O-; n is an integer of 2 or 3; 
R¹ and R² independently represent alkyl of 1 to 10 carbons or substituted alkyl of 1 to 10 carbons; 
R³ represents a ring chosen from the set consisting of aryl, substituted aryl, and a heterocyclic ring containing 5 or 6 carbons in the ring with the proviso that when R³ is aryl or substituted aryl, n must be 2. 
R⁴, R⁵, R⁶ and R⁷ independently represent hydrogen, alkyl of 1-10 carbons, substituted alkyl of 1-10 carbons, R⁴ and R⁵ taken together or R⁶ and R⁷ taken together may represent the atoms necessary to form a 5 or 6-membered aliphatic ring, an aromatic six-membered ring, an aromatic 10-membered ring, a substituted aromatic six-member ring or a substituted aromatic 10-member ring; 
R⁸, R⁹ independently represent alkyl of 1-10 carbons, substituted alkyl of 1-10 carbons, aryl of 6-10 carbons, substituted aryl of 6-10 carbons; 
R¹⁰ represents an alkyl of 1-10 carbons, substituted alkyl of 1-10 carbons, aryl of 6-10 carbons, substituted aryl of 6-10 carbons; 
Q represents a counterion.

Dispositif d'affichage (9) pour mouvement d'horlogerie (1), ledit dispositif d'affichage (9) comprenant : 
- un premier engrenage (11) destiné à être entraîné par un organe moteur (3) que comporte ledit mouvement (1) ; 
- un dispositif de correction principal (15) agencé pour entraîner sélectivement ledit premier engrenage (11) ; 
- un premier engrenage correcteur (19) comprenant une première entrée (19a ; 27 ; 43) agencée pour être entraînée par ledit premier engrenage (11), une seconde entrée (19b ; 29 ; 45) destinée à être entraînée manuellement par pas, et une sortie (19c ; 25, 33 ; 25, 51), agencée pour entraîner un premier organe d'affichage (23) d'une première indication liée au temps. 
- un second engrenage correcteur (57) comprenant une première entrée (57a) agencée pour être entraînée par ladite sortie (19c ; 25, 33 ; 25 ; 51) dudit premier engrenage correcteur (19), une seconde entrée (57b) destinée à être entraîné manuellement par pas, et une sortie (57c) agencée pour entraîner un deuxième organe d'affichage (61) d'une deuxième indication liée au temps.
